Luckily, I had a great test subject today in the form of a professional opera singer all the way from Slovokia!

My client is a narrow who is turned right and has a tough time "feeling" her left hamstring.

One of my major takeaways from Katie's presentation was that Narrows often require more feedback or closed loop inputs due to an inability to get grounded and own mid-stance.

What I came away with for my client was a series of actions complexed together in which we move from heel strike to mid-stance while maintaining a sensory target (left hamstring) to allow for more feedback.

This is more volume than I would typically devote to such an activity, but it made the change we were looking for in her ADT and made her noticeably more aware of this area.

Exercise sequence included below:

1. Quadruped wall hip shift- Made this one up because narrows need hamstrings too.

2. Early stance squat

3. Knee drive with perturbations- The objective is to maintain hamstring reference against rapid movement in different directions.

4. Step thrus- Transition to other side.

If you haven't signed up for Katie's webinar, I recommend it immediately and prepare for your brain to explode!";}i:108;a:1:{s:14:"comments_count";i:1;}i:109;a:1:{s:11:"likes_count";i:0;}i:110;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu8ZrTnVjP";}i:111;a:1:{s:5:"image";s:238:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118772363_177663360474183_8836849668082284687_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=103&_nc_ohc=ljUJow0hjWEAX8kcAKP&oh=2db4131f01b4414293ac1d92b07d9392&oe=5F556116";}i:112;a:1:{s:4:"type";s:7:"sidecar";}i:113;a:1:{s:8:"owner_id";i:1380628849;}i:114;a:1:{s:14:"owner_username";s:0:"";}i:115;a:1:{s:14:"owner_fullname";s:0:"";}i:116;a:1:{s:9:"owner_pic";s:0:"";}i:117;a:1:{s:2:"id";s:19:"2391113507019942578";}i:118;a:1:{s:10:"short_code";s:11:"CEu8RDjj-qy";}i:119;a:1:{s:12:"created_time";i:1599263029;}i:120;a:1:{s:7:"caption";s:602:"üîòBodyweight and KB workout üîò Reverse crunches and pull up üîò#bodypositivity üîò #igfitness .
